import styled from "styled-components";
import { FiEye } from "react-icons/fi";
import DataStatus from "./DataStatus";

const MainBase = styled.div`
  padding: 2em;
  color: snow;
`;

const Header = styled.div`
  display: flex;
  align-items: center;
  justify-content: space-between;
`;

const Logo = styled.h1`
  display: flex;
  // align-items: center;
  // justify-content: space-between;
`;

const Main = ({ data = [] }) => {
  return (
    <MainBase>
      <Header>
        <Logo>
          <FiEye style={{ marginRight: "10px" }} />
          <span>Lil Brother</span>
        </Logo>
        <DataStatus data={[]} />
      </Header>

      {data.map((item) => (
        <div>{item.id}</div>
      ))}

      {JSON.stringify(data)}
    </MainBase>
  );
};

export default Main;
